=======

Rosetta is a 17-year-old Italian girl who lives in a trailer park on the
outskirts of the Belgian town of Seraing. Drowning in poverty and neglect,
she is driven by a need that quickly becomes her singular obsession:
securing a steady job and a normal life, but her single-mindedness may
lead her to make a choice that she may not be prepared to accept.

